	window.province={
		/**
		根据父级显示子集集合
		**/
			children:function(pcode){
			var city_list=[];
			for(var code in city_data){
				var city=city_data[code];
				var parent_code=city['parent_code'];
				if(parent_code==pcode){
					city_list.push(city);
				}
			}
			return city_list;
		},
		/**
		根据父级显示select标签的option标签
		**/
		childrenOption:function(pcode){
			var option_data=this.children(pcode);
			var h=[];
			for(var i =0;i<option_data.length;i++){
				var _code=option_data[i]['code'];
				var _name=option_data[i]['name'];
				h.push('<option value="'+_code+'">'+_name+'</option>');
			}
			return h.join('');
		},
		/**
		根据code显示同等级的数据集合
		**/
		siblings:function(code){
			var city=city_data[code]; 
			if(typeof city=='undefined'){return null;}
			var parent_code=city['parent_code']; 
		 
			return this.children(parent_code); 
		},
		/**
		根据code显示同等级select标签的option标签，并默认选中
		*/
		siblingsOption:function(code){
			var option_data=this.siblings(code); 
			if(option_data==null){return "";}
			var h=[];
			for(var i =0;i<option_data.length;i++){
				var _code=option_data[i]['code'];
				var _name=option_data[i]['name'];
				h.push('<option ');
				if(code==_code){
					h.push(' selected="selected" ');
				}
				h.push(' value="'+_code+'">'+_name+'</option>');
			}
			return h.join('');
		},
		/**
		 * 根据code显示对应的数据对象
		 * */
		getObjByCode:function(code){
			return city_data[code];
		},
		getNameByCode:function(code){
			var data=this.getObjByCode(code);
			return typeof data!='undefined' ? data.name:'';
		}
	};
